import fs from "fs"

const getCountry = (name:string):string => {
    const state = name.substr(-2, 2);
    return state;
}

const getState = (name:string):string => {
    const state = name.substr(-5,2);
    const test = state.substr(-1,1);
    return test === ","?"":state;
}

export const noaaStationSeed = noaaStationSeed1.map(obj => {
    return {
        stationCod: obj.id,
        name: obj.name,
        status: "enabled",
        type: "automatic",
        city: obj.name,
        state: getState(obj.name),
        elevation: obj.elevation,
        country: getCountry(obj.name),
        entity: "noaa",
        lat: obj.latitude,
        lng: obj.longitude
    }
})

